function curry(fn, outArgs) {
  let len = fn.length;
  return function () {
    let all_arg = [...outArgs, ...arguments];
    if (all_arg.length >= len) {
      fn.apply(this, all_arg);
    } else {
      return curry(fn, all_arg);
    }
  };
}

function count() {
  return curry(sum, arguments);
}

