function curry(fn, outArgs) {
  return function (...arg) {
    let all_arg = [...outArgs, ...arg];
    if (arg.length === 0) {
      return fn.apply(this, all_arg);
    } else {
      return curry(fn, all_arg);
    }
  };
}

function fn(...arg) {
  return curry(sum, arg);
}
